import{_ as e,o,c as i,z as t,a}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 58.1-915 Petition of domiciliary state for accounting.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/58.1-915.md","filePath":"vacode/58.1-915.md"}'),n={name:"vacode/58.1-915.md"},c=t("h1",{id:"§-58-1-915-petition-of-domiciliary-state-for-accounting",tabindex:"-1"},[a("§ 58.1-915 Petition of domiciliary state for accounting. "),t("a",{class:"header-anchor",href:"#§-58-1-915-petition-of-domiciliary-state-for-accounting","aria-label":'Permalink to "§ 58.1-915 Petition of domiciliary state for accounting."'},"​")],-1),r=t("p",null,"Within sixty days after the mailing of such notice, the official or body charged with the administration of the death tax laws of the domiciliary state may file with such court in this Commonwealth a petition for an accounting in such estate. Such official body of the domiciliary state shall, for the purpose of this article, be a party interested for the purpose of petitioning the court for such accounting. If such petition be filed within the period of sixty days, the court shall decree such accounting and upon such accounting being filed and approved shall decree the remission of the fiduciary appointed by the domiciliary probate court of the balance of the intangible personalty after the payment of creditors and expenses of administration in the Commonwealth.",-1),s=t("p",null,"Code 1950, § 58-238.20; 1978, c. 838; 1984, c. 675.",-1),d=[c,r,s];function h(f,l,p,u,m,_){return o(),i("div",null,d)}const b=e(n,[["render",h]]);export{g as __pageData,b as default};
